<head>
<style>
div {
background-color:black;
}

html {
     margin: 0; 
     padding: 0; 
     height: 100%; 
     background: black; 
}

body {
     margin: 0; 
     padding: 0; 
     height: 100%; 
     max-height: 100%; 
}

#container{
     margin: 0;
     width: 100%;
}

#content {
  background-color: #3498db36;
  box-shadow: 0 0 10px 0 #3498db inset, 0 0 10px 4px #3498db;
  max-width: 90%;
  max-height: 90%;
}

#copy {
    display:none;
}

#camera {
    display : none;
}

#controls {
    width: 100%;
    align-items: center;
    justify-content: center;
}

button {
    width : 18%;
}

.btn {
  box-sizing: border-box;
  -webkit-appearance: none;
  -moz-appearance: none;
  appearance: none;
  background-color: transparent;
  border: 2px solid #e74c3c;
  border-radius: 0.6em;
  color: #e74c3c;
  cursor: pointer;
  align-self: center;
  font-size: 1rem;
  font-weight: 400;
  line-height: 1;
  margin: 0.5%;
  padding: 5px 30px;
  height: 40px;
  text-decoration: none;
  text-align: center;
  text-transform: uppercase;
  font-family: "Montserrat", sans-serif;
  font-weight: 700;
}

.btn:hover, .btn:focus {
  color: #fff;
  outline: 0;
}

.animate {
  border-color: #3498db;
  color: #fff;
  box-shadow: 0 0 40px 40px #3498db inset, 0 0 0 0 #3498db;
  transition: all 150ms ease-in-out;
}

.animate:hover {
  box-shadow: 0 0 10px 0 #3498db inset, 0 0 10px 4px #3498db;
}

h1 {
  color: white;
  text-align:center;
  height: 16px;
  margin : 8px;
  font-family: "Montserrat", sans-serif;
}

#resolution {
  width: 88%;
  margin-left: 5%;
}

#buttons {
  width: 88%;
  margin:auto;
  display: flex;
  align-items: center;
  justify-content: center;
}

#media {
  margin:auto;
  display: flex;
  align-items: center;
  justify-content: center;
  padding : 2px;
  max-height: 90%;
  height: 80%;
}

</style>

<h1> Am I AI 1: We ourselves are art</h1>
<div id="container">
    <div id="media">
      <canvas id="content"></canvas>
    </div>
    <canvas id="copy"></canvas>
    <video id="camera" autoplay="" muted=""> </video>

    <div id="controls">
     <input type="file" id="fileupload" style="display: none" accept="image/*"/>

       
     <div id="buttons">
       <button class="btn animate" onclick="lowRes()">Res-</button>
       <button class="btn animate" onclick="startVideo()">Start</button>
       <button class="btn animate" onclick="loadImage()">Load</button>
       <button class="btn animate" onclick="saveCanvas()">Save</button>
       <button class="btn animate" onclick="highRes()">Res+</button>

     </div>
    <div>
<div>

<script>
var canvas = document.getElementById('content');
canvas.style.width = "90%";
canvas.style.height = "90%";
    
const video = document.getElementById("camera");
var last_frame;
var resolutions = [[1024, 768], [1280, 720], [1920, 1080], [2560, 1440],[3840, 2160],[5120, 2880]]; 
var W = 1024;
var H = 768;
var drawTimeInterval= null;
var last_resolution = 0;


function loadImage()
{
  var fileupload = document.getElementById("fileupload");
  fileupload.click();
  fileupload.onchange = function (e) {
    console.log(e);
    var reader = new FileReader();
    reader.onload = function ()
    {
          base_image = new Image();
          base_image.src = reader.result;
          base_image.onload = function(){
            copy = document.getElementById('copy');
            W = base_image.width*(last_resolution+1);
            H = base_image.height*(last_resolution+1);
            copy.width = W;
            copy.height = H;
            ctx = copy.getContext('2d');
            ctx.drawImage(base_image, 0, 0, W, H);
            drawFrame();
          
      }
      if (drawTimeInterval)
        clearInterval(drawTimeInterval);
    }
    reader.readAsDataURL(event.srcElement.files[0]);
  }
}



var last_update = 0;
function drawFrame()
{
    canvas = document.getElementById('content');
    canvas.width = W;
    canvas.height = H;
    canvas.style.width = "";
    canvas.style.height = "";
    
    canvas_ctx = canvas.getContext('2d');
    if (last_frame)
        canvas_ctx.putImageData(last_frame, 0, 0);
    
    copy = document.getElementById('copy');
    ctx = copy.getContext('2d');
    const frame = ctx.getImageData(0, 0, W, H);
    const length = frame.data.length;
    let data = frame.data;
    let blocksx = Math.ceil(H/28);
    let blocksy = Math.ceil(W/28);
    let max = 0;
    
    /* 
    for (let i=0;i<data.length;i++)
     if (max < data[i])
        max =data[i];
    console.log(max);
    // Normalization should work
    */
    for(let i=0;i<blocksx;i++)
        for(let j=0;j<blocksy;j++)
        {
            basex = i*28;
            basey = j*28;
            let count = 0;
            let sum = 0;
            for (offsetx=0;offsetx<28;offsetx++)
                for (offsety=0;offsety<28;offsety++)
                {
                    base = ((basex+offsetx)*W + (basey+offsety))*4;  
                    sum += data[base];
                    count++;
                }
            let idx = parseInt(sum/count);
            if (isNaN(idx)) idx=0;
            let digit_image = mapper[idx];
            if (digit_image === undefined) continue;

            for (offsetx=0;offsetx<28;offsetx++)
                for (offsety=0;offsety<28;offsety++)
                {
                let base = ((basex+offsetx)*W + (basey+offsety))*4;  
                let intensity = digit_image[offsetx][offsety]*0.9 + idx * 0.1;
                data[base]  =  intensity * 0.1;
                data[base+1] = intensity * 1;
                data[base+2] = intensity * 0.6;
                }
        }

    last_frame = frame;
    ctx = canvas.getContext('2d');
    ctx.putImageData(frame, 0, 0);

}

function drawEmpty(){
  canvas = document.getElementById('content');
  canvas.width = W;
  canvas.height = H;
  canvas.style.width = "";
  canvas.style.height = "";
  ctx = canvas.getContext('2d');
  const frame = ctx.getImageData(0, 0, W, H);
  const length = frame.data.length;
  let data = frame.data;
  for(i=0;i<H;i++)
    for(j=0;j<W;j++)
      { 
        base = (W*i + j)*4
        data[base] = 255*(((i + j)%16)<8);
        data[base+1] = 255*(((i + j)%16)<8);
        data[base+2] = 255*(((i + j)%16)<8);
        data[base+3] = 255;
      }
   ctx.putImageData(frame, 0, 0);
}


function drawFromVideo()
{
  copy = document.getElementById('copy');
  copy.width = W;
  copy.height = H;
  copy.style.width = W;
  copy.style.height = H;
  ctx = copy.getContext('2d');
  ctx.drawImage(video, 0, 0, W, H);
  drawFrame();
}

function updateResolution()
{
  let res = resolutions[last_resolution]
  W = res[0];
  H = res[1];
}

function highRes()
{
  last_resolution += 1;
  if (last_resolution>=resolutions.length)  
    last_resolution = resolutions.length - 1;
  updateResolution();
  drawEmpty();
}

function lowRes()
{
  last_resolution -= 1;
  if (last_resolution < 0)
    last_resolution = 0;
  updateResolution();
  drawEmpty();
}

function saveCanvas(){
    canvas = document.getElementById('content');
    const link = document.createElement('a');
    link.style.display = 'none';
    document.body.appendChild(link)
    link.setAttribute('download', 'amiai.png');
    link.setAttribute('href', canvas.toDataURL().replace("image/png", "image/octet-stream"));
    link.click();
}

function startVideo()
{
    navigator.mediaDevices.getUserMedia({video:{}}).then(
    function(stream){
        video.srcObject = stream
        updateResolution();
        //video.addEventListener('timeupdate', drawFrame, false);
        setTimeout(function (){ drawTimeInterval=setInterval(drawFromVideo, 100)}, 100);
        video.play()
    })
}
